import React from 'react';
import './App.css';
import Todolist from "./components/Todolist";

function App() {
    const task1 = [
        {id: 1, title: 'HTML&CSS', isDone: true},
        {id: 2, title: 'React', isDone: false},
        {id: 3, title: 'TypeScript', isDone: true}
    ]
    const task2 = [
        {id: 1, title: 'Storybook', isDone: true},
        {id: 2, title: 'Python', isDone: false},
        {id: 3, title: 'C++', isDone: true}
    ]


    return (
        <div className="App">
            <Todolist title={'New York'} tasks={task1}/>
            <Todolist title={'Chicago'}/>
            <Todolist title={'San Francisco'}/>
        </div>
    );
}

export default App;
